export class Zapatilla {
  
    public nombre:string;
    public precio:number;
    public marca:string;
    public color:string;
    public existencia:boolean;

    constructor({ nombre, precio, marca, color, existencia }:{
        this.nombre = nombre;
        this.precio = precio;
        this.marca = marca;
        this.color = color;
        this.existencia = existencia;
    }
}
